import React,  {Component} from "react";
import "./bookCard.css";

export default class BookCard extends Component {
    constructor(props){
        super(props);
    }

    render() {
        const {bookItem} = this.props; 
        return(
            <div className="card">
                <img className="book-img" src={bookItem.image}/>
                <div className="card-info">
                <h4 className="book-title">{bookItem.title}</h4>
                <h5 className="book-author">{bookItem.author}</h5>
                <h4 className="book-price">{bookItem.price}</h4>
                </div>
            </div>
        );
    }
}
